                ops.push(s[i]);
                num = 0;
            }
        }
        while (!ops.empty()) {
            int op2 = nums.top();
            nums.pop();
            int op1 = nums.top();
            nums.pop();
            char op = ops.top();
            ops.pop();
            num = applyOp(op1, op2, op);
            nums.push(num);
        }
        return nums.top();
    }

    bool hasPrecedence(char op1, char op2) {
        if (op2 == '(' || op2 == ')') return false;
        if ((op1 == '*' || op1 == '/') && (op2 == '+' || op2 == '-')) return false;
        return true;
    }

    int applyOp(int op1, int op2, char op) {
        switch (op) {
            case '+':
                return op1 + op2;
            case '-':
                return op1 - op2;
            case '*':
                return op1 * op2;
            case '/':
                return op1 / op2;
        }
        return 0;
    }
};

