class Solution {
public:
    int maxProduct(vector<int>& nums) {
        int n = nums.size();
        int max_product = nums[0];
        int min_product = nums[0];
        int ans = nums[0];
        for(int i=1;i<n;i++) {
            int curr_max = max(max(max_product * nums[i], min_product * nums[i]), nums[i]);
            int curr_min = min(min(max_product * nums[i], min_product * nums[i]), nums[i]);
            max_product = curr_max;
            min_product = curr_min;
            ans = max(ans, max_product);
        }
        return ans;
    }
};

