    string s;
    getline(cin, s);
    int n = s.size();
    int ans = 0;
    int curr = 0;
    int sign = 1;
    for (int i = 0; i < n; ++i) {
        if (s[i] == ' ') {
            ans += sign * curr;
            curr = 0;
            sign = 1;
        } else if (s[i] == '+') {
            ans += sign * curr;
            curr = 0;
            sign = 1;
        } else if (s[i] == '-') {
            ans += sign * curr;
            curr = 0;
            sign = -1;
        } else {
            curr = curr * 10 + s[i] - '0';
        }
    }
    ans += sign * curr;
    cout << ans << endl;
